import axios from "axios";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

const URI = "http://localhost:8000/users/";

const CompCreateUser = () => {

    const [alias, setAlias] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    //Guardar Usuario

    const user = {
        alias: alias,
        email: email,
        password: password
    }

    const store = async (e) => {
        e.preventDefault();
        await axios.post(URI, user);
        navigate('/');
    }


    return(
        <div>
            <h3>Registrar Usuario</h3>
            <form onSubmit={store}>
                <div>
                    <label>Alias</label>
                    <input type="text" className="form-control" onChange={(e)=>setAlias(e.target.value)} value={alias}/>
                    <label>Email</label>
                    <input type="text" className="form-control" onChange={(e)=>setEmail(e.target.value)} value={email}/>
                    <label>Password</label>
                    <input type="text" className="form-control" onChange={(e)=>setPassword(e.target.value)} value={password}/>                    
                </div>
            </form> 
        </div>

    )
}

export default CompCreateUser;
